import { configureStore } from "@reduxjs/toolkit";
import jwtReducer from "./Slices/JwtSlice";
import userReducer from "./Slices/userSlice";

export default configureStore(
    {
        reducer:{
            jwt:jwtReducer,
            user:userReducer,
        }
    }
)
